const LoadingSpinner = () => {
    return (
        <div className= "d-flex justify-content-center">
          <div className="spinner-border" role="status">
             <span class="visually-hidden">Loading .....</span>
          </div>
        </div>

    );

};

export default LoadingSpinner;
